import React from "react";
import fb from "../../Assets/fb.png";
import coin from "../../Assets/coin.png";
import star from "../../Assets/star.png";
const Header = () => {
  return (
    <>
      <div className="grid grid-cols-1 sm:grid-cols-3 md:grid-cols-3 ">
        <div className=" py-3  rounded-tr-3xl rounded-br-3xl bg-gradient-to-t from-yellow-600 via-amber-200 to-yellow-500">
          <div className="flex justify-between">
            <div>
              <img src={fb} height={30} alt="#" width={20} className="ms-3" />
            </div>
            <div className="flex me-6">
              <img
                src={coin}
                height={30}
                width={20}
                className="ms-3 relative -right-4"
              />
              <p className="bg-pink-900 rounded-full px-9 text-center text-white">
                100,214,474
              </p>
            </div>
          </div>
        </div>
        <div className="bg-green-600 text-center  border-b-4 border-black outline-double outline-yellow-300 text-2xl  flex justify-center rounded-full text-white font-bold bg-gradient-to-t from-green-500 via-amber-400 to-green-500">
          <button>BUY</button>
        </div>
        <div className=" py-3  rounded-bl-3xl rounded-tl-3xl bg-gradient-to-t from-yellow-600 via-amber-200 to-yellow-500">
          <div className="flex justify-center">
            <div className="flex me-6">
              <img
                src={star}
                alt="#"
                height={20}
                width={20}
                className="ms-3 relative -right-3"
              />
              <div className="bg-brown-900 px-14">
                   <div className="" >30</div>
              </div>
              {/* <input
                type="range"
                className=" w-full bg-yellow-200 h-6 rounded-md outline-none"
                style={{ padding: "10px" }}
              /> */}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
